package com.cn.umessage.utils;

import java.util.ArrayList;
import java.util.List;

import org.apache.http.HttpEntity;
import org.apache.http.NameValuePair;
import org.apache.http.client.entity.UrlEncodedFormEntity;
import org.apache.http.client.methods.CloseableHttpResponse;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.impl.client.CloseableHttpClient;
import org.apache.http.impl.client.HttpClients;
import org.apache.http.message.BasicNameValuePair;
import org.apache.http.util.EntityUtils;

import com.alibaba.fastjson.JSON;
import com.alibaba.fastjson.JSONObject;

public class CampareImageUtil {

	static String api_key = "kYdd0yOANof8dWoTo1riVjSvwxw3MDaU";
	static String api_secret = "e-HwYUfWPEQGgSI32nFOcs2NaIL9born";

	public static Double compare(String image_base64_1, String image_base64_2)
			throws Exception {
		String url = "https://api-cn.faceplusplus.com/facepp/v3/compare";
		CloseableHttpClient client = HttpClients.createDefault();
		HttpPost post = new HttpPost(url);

		List<NameValuePair> nvps = new ArrayList<NameValuePair>();
		nvps.add(new BasicNameValuePair("api_key", api_key));
		nvps.add(new BasicNameValuePair("api_secret", api_secret));
		nvps.add(new BasicNameValuePair("image_base64_1", image_base64_1));
		nvps.add(new BasicNameValuePair("image_base64_2", image_base64_2));

		post.setEntity(new UrlEncodedFormEntity(nvps, "UTF-8"));
		CloseableHttpResponse resp = client.execute(post);
		HttpEntity entity = resp.getEntity();
		String res = EntityUtils.toString(entity);

		JSONObject obj = JSON.parseObject(res);
		Double confidence = obj.getDouble("confidence");

		EntityUtils.consume(entity);
		if (resp != null) {
			resp.close();
		}
		if (post != null) {
			post.releaseConnection();
		}
		if (client != null) {
			client.close();
		}

		return confidence;
	}

	public static void main(String[] args) throws Exception {
		String base01 = "";
		System.out.println(compare(base01, base01));
	}

}
